  input: 'TEXT,F3XA,,"RE: Ltr dated Aug 2, 2006, (1) the memo schedules has been uploaded.  (2)
    The payment was paid to the USPS through a mail house ''Jewett Printing'', because
    we were recently added to the EasyPermit Postage Account were all postal mailings
    are to be billed through the EasyPermit Postage Account and not paid at the post
    office.  The postage for this mailing was paid for in April and will appear in
    the May monthly report. (3) the payments made for media buy, postage meter, and
    printing were not for public communications that clearly refer to any federal
    office, or fall under FEA definition.  (4) None of our employees for this months
    spent more than 25% of their time in connection with a Federal Election or on
    FEA.  (4) The ratio for the administrative category has been corrected.  This
    did not cause the non federal account to overpay  the federal account.  (5) payments
    made for media buy on line 21a were not for any communication that clearly refer
    to any federal office, or fall under FEA.(6) the payment to the Voter Activation
    Network is for the mainetance of the web service and not for any voter drive activities
    and therefore we do not believe should fall under Voter Drive expense"'
